import "./technology.scss";
import React, { useEffect, useRef } from 'react'; 
import AOS from 'aos';
import 'aos/dist/aos.css'; // You can also use <link> for styles

const skills = [
    { href: '#git_', title: 'Git' },
    { href: '#json_', title: 'JSON' },
    { href: '#solidity_', title: 'Solidity' },
    { href: '#html_', title: 'HTML' },
    { href: '#react_', title: 'React' },
    { href: '#python_', title: 'Python' },
  ];

export default function Intro() {
    
    useEffect(() => {
        console.log('Loading TagCanvas...');
        const TagCanvas = window.TagCanvas;
        const tagCanvasOptions = {
          textColour: '#08FDD8',
          outlineThickness: 0.5,
          outlineColour: '#FE0853',
          maxSpeed: 0.06,
          freezeActive: true,
          shuffleTags: true,
          shape: 'sphere',
          zoom: 1.5,
          wheelZoom: false,
          noSelect: true,
          textFont: null,
          freezeDecel: true,
          fadeIn: 3000,
          initial: [0.3, -0.1],
          depth: 1.1,
        };
        try {
          TagCanvas.Start('tagcanvas', 'taglist', tagCanvasOptions);
        } catch (e) {
          console.log('Canvas error.');
          console.log(e);
        }
      }, []);


    return (
        <div class="bdy2" >
         
         
   <div class="Heading">
                <h1>
                    Tech and Tools
                </h1>
                <h2>I've been recently working on </h2>
            </div>
            <div className="techWrapper">

                <div class="techLeftWrapper">
                    <img src="assets/header-img.svg"></img>

                </div>
                <div class="techRightWrapper">
                    <div class="skills-charts">
                        <div id="myCanvasContainer">
                            <canvas 
                            id='tagcanvas'
                            width='820'
                            height='600'
                            style={{
                              maxWidth: '1000px',
                              width: '100%',
                              zIndex: '99',
                              position: 'relative',
                              margin: '0 auto',
                            }}
                            className='to-fade-in fast-anim'>
                            </canvas>
                                <div id='taglist' style={{ display: 'none' }}>
                                <ul >
                                    <li><a href="#">HTML</a></li>
                                    <li><a href="#">CSS</a></li>
                                    <li><a href="#">Data Science</a></li>
                                    <li><a href="#">Python</a></li>
                                    <li><a href="#">Node JS</a></li>
                                    <li><a href="#">React</a></li>
                                    <li><a href="#">Git</a></li>
                                    <li><a href="#">HTML</a></li>
                                    <li><a href="#">HTML</a></li>
                                    <li><a href="#">HTML</a></li>
                                    <li><a href="#">HTML</a></li>
                                </ul>
                                </div>
                        </div>
                    </div>
                </div>
            </div>




</div>
    )
}
